import { Avatar, Button, Grid, Paper, TextField } from '@material-ui/core';
// import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import React from 'react';


const SignLog = (props) => {
    const {email,setEmail,password,setPassword, handleLogin,handleSignUp,hasAcc,setHasAcc,emailError,passwordError} = props;
    const paperStyle = {padding:40, height:'70vh', width:300, margin:'30px auto'}
    const avatarStyle= {backgroundColor:'green'}
    return (
        <div>
            <Grid>
                <Paper elevation = {11} style = {paperStyle}>
                    <Grid align='center'>
                        <Avatar style={avatarStyle}></Avatar>
                        {/* <div style={{color:'red',fontsize:'3px'}}>{errMsg}</div>  */}
                        <h2>Sign In</h2>
                        <TextField required 
                        label="Username" 
                        placeholder="Enter Username OR Phone number"
                        value = {email}
                        onChange={(e)=> setEmail(e.target.value)}
                        />
                        <p>{emailError}</p>
                        <TextField required
                        label="Password"
                        type="password"
                        placeholder="Enter Password"
                        onChange={(e)=> setPassword(e.target.value)}
                        />
                        <p>{passwordError}</p>
                    </Grid>
                 <br></br>
                 <div style={{display:"flex",justifyContent:"center", alignItems:'center'}}>
                     {hasAcc ? (
                         <>
                            <Button 
                                variant="contained"
                                color="primary" 
                                //fullWidth ={validateFrom()}
                                // onClick={routeChange}
                            >
                            Sign In
                            </Button>
                         </>

                     ):(
                         <> 
                            <Button 
                                variant="contained"
                                color="primary" 
                                //fullWidth ={validateFrom()}
                                // onClick={routeChange}
                            >
                            Sign up
                            </Button>
                         </>

                     ) }

                 </div>

             </Paper>
            </Grid>
        </div>
    )
}

export default SignLog;
